import './App.css';

function App() {
  return (
    <div className="App">
    <div className="container" style={{
      backgroundColor:"red",
      height: "90vh",
      width: "50vw",
      margin: "auto",
      marginTop: "20px",
      padding: "10px",
      borderRadius: "10px",
      }}>
      <h2>내 일주일 평가</h2>
    </div> 
    </div>
  );
}

export default App;
